	add("mamo", "{\"term\":\"mamo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|haw|mamo|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of two extinct species of Hawaiian honeycreepers of the genus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA 2003, p. 421\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In 1907, when a well-known collector named Alanson Bryan realised that he had shot the last three specimens of black \u0027\u0027mamos\u0027\u0027, a species of forest bird that had only been discovered the previous decade, he noted that the news filled him with ‘joy’.Category:en:Perching birds\", \"priority\":3}]}, \"synonyms\":{}}");

