	add("mamaroneck", "{\"term\":\"mamaroneck\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"munsee\", \"unami\"], \"text\":\"From an name. Nora Thompson Dean suggested Unami \u0027mehëmalunèk\u0027 (place to dance) Whritenour suggested the more plausible Munsee \u0027maamaalahneek\u0027 (striped stream) \u0026lt;ref\u0026gt;Robert S. Grumet, \u0027Manhattan to Minisink: American Indian Place Names of Greater New York\u0027\u0026lt;/ref\u0026gt; from \u0027\u0027 (maamaaleew) \u0026lt;ref\u0026gt;William Bright, \u0027Native American Placenames of the United States\u0027\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A town located on the Long Island Sound in Westchester County, New York, on land purchased from Native Americans in 1661\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mameluke", "{\"term\":\"mameluke\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"French\"], \"text\":\"From French \u0027mamelouk\u0027 () ultimately from Arabic \u0027مَمْلُوك\u0027 (slave) (literally \u0026quot;possessed\u0026quot;), passive participle of \u0027مَلَكَ\u0027 (to possess, to acquire)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a military regime created and run originally by freed white slaves, which formed a ruling caste in Egypt from 1250 until 1812 and in Syria until 1516\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Mammalukes\u0027\u0027 boast, that they have the nimblest and readiest horses of any men at armes in the world\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p.574\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He first smashed the native \u0027\u0027Mameluke\u0027\u0027 army at the battle of the Pyramids on 21 July, and secured lower Egypt before leading an expedition in Syria against Turkish forces\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 278\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Mamluks\u0027\u0027, who seized power in Egypt in 1250, were a caste of men captured for military service, so they drew their identity from their defence of Islam against its enemies\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A slave (especially white) in a Muslim country\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, \u0027The Book of the Thousand Nights and a Night\u0027, Night 1\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Having accepted this advice the King forthwith bade prepare handsome gifts, such as horses with saddles of gem encrusted gold; \u0027\u0027Mamelukes\u0027\u0027, or white slaves; beautiful handmaids, high breasted virgins, and splendid stuffs and costly\", \"priority\":9}]}, \"synonyms\":{}}");

	add("mammy", "{\"term\":\"mammy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"mamma; mothe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the southern United States, a black nanny employed to look after white children\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mammal", "{\"term\":\"mammal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Modern Latin {{m|la|Mammalia}}, coined 1758 by {{w|Linnaeus}} for the class of mammals, from neuter plural of {{m|la|mammalis||of the breast}}, from Latin {{m|la|mamma||breast}}, perhaps cognate with mamma (mother).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An animal of the class Mammalia, characterized by being warm-blooded, having hair and feeding milk to its young\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vertebrate with three bones in the inner ear and one in the jaw\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mammaldom", "{\"term\":\"mammaldom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mammal|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being a mammal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, Alan Devoe, \u0027This Fascinating Animal World\u0027, page 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The whole of this vast \u0027\u0027mammaldom\u0027\u0027 which so dwarfs us is itself no more than a tenth of the entirety of the vertebrates (the backboned animals\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Christopher McDougall, \u0027Born to Run\u0027, page 214\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But why, in all \u0027\u0027mammaldom\u0027\u0027, would a jackrabbit need a spring-loaded belly\", \"priority\":5}]}, \"synonyms\":{}}");

