	add("mammet", "{\"term\":\"mammet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027maumet\u0027 shortened form of \u0027mauhoumet\u0027 \u0027mahumet\u0027 from \u0027mahumet\u0027 (muhammad) See \u0027muhammad\u0027 for more.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A false god; an idol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A doll or puppet; a lifeless figure, an effigy, a scarecrow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"c. 1595\u0027\u0027, \u0027\u0027, Act 3 scene 5\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And then to haue a wretched puling foole, / A whining \u0027\u0027mammet\u0027\u0027, in her Fortunes tender, / To answer, Ile not wed, I cannot Loue: / I am too young, I pray you pardon me\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027The Book of Ebenezer Le Page\u0027, New York 2007, p. 49\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He didn\u0027t want to go, and I didn\u0027t want him to go; and we stood there like two \u0027\u0027mommets\u0027\u0027 and there was nothing we could say\", \"priority\":6}]}, \"synonyms\":{}}");

	add("mammock", "{\"term\":\"mammock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix||alt1\u003dmam (of obscure origin)|ock|gloss2\u003ddiminutive suffix|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shapeless piece; a fragment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The bird liveth by the scraps, and feedeth upon the leavings of that monster, who gently receiveth him into his mouth, and suffers him to pecke his jawes and teeth for such \u0027\u0027mamockes\u0027\u0027 of flesh as sticke betweene them\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"|passage\u003d\u0026quot;Then, by St. Thomas of Canterbury,\u0026quot; replied Gurth, \u0026quot;we will have the castle, should we tear it down with our hands!\u0026quot; / \u0026quot;We have nothing else to tear it with,\u0026quot; replied Wamba; \u0026quot;but mine are scarce fit to make \u0027\u0027mammocks\u0027\u0027 of freestone and mortar.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

