	add("mammon", "{\"term\":\"mammon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"official aramaic (700-300 bce)\", \"English\", \"ancient greek (to 1453)\", \"Hebrew\"], \"text\":\"From \u0027mammona\u0027 (wealth) from Hellenistic Ancient greek (to 1453) \u0027μαμωνᾶς\u0027 from Official aramaic (700-300 bce) \u0027ממונא\u0027 (riches) Compare with Hebrew {{m|he|מָמוֹן|tr\u003dmamón|gloss\u003dmoney, property, capital|g\u003dm}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The desire for wealth personified as an evil spirit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Wealth, material avarice, profit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Edwin Mullins, \u0027The Popes of Avignon\u0027, Blue Bridge 2008, p. 43\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The proper sphere of the church, after all, was the kingdom of God, not greedy earthbound kingdoms of \u0027\u0027mammon\u0027\u0027, which should be left to temporal authorities to rule and squabble over\", \"priority\":4}]}, \"synonyms\":{}}");

