	add("mammoth", "{\"term\":\"mammoth\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"mansi\", \"Russian\"], \"text\":\"From obsolete Russian {{m|ru|мамант}} (modern {{m|ru|мамонт}}), probably from an language, like Proto-Mansi \u0027*mē̮ŋ-ońt\u0027 ‘earth-horn’ (compare Northern Mansi {{m|mns|ма|tr\u003dmā||earth}}, {{m|mns|аньт|tr\u003dāńt||horn}}) or Compare Proto-Uralic {{m|urj-pro|*mëxe||earth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any species of the extinct genus \u0027Mammuthus\u0027, of large, usually hairy, elephant-like mammals with long curved tusks and an inclined back, which became extinct with the last retreat of ice age glaciers during the late Pleistocene period, and are known from fossils, frozen carcasses, and Paleolithic cave paintings found in North America and Eurasia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d The Philosophical Transactions of the Royal Society of London, from Their Commencement in 1665 to the Year url\u003d original\u003d|chapter\u003d An Account of Elephants Teeth and Bones, found under section\u003d Three Years Travels from Moscow Over-land to China: Thro\u0027 Great Ustiga, Siriania, Permia, Sibiria, Daour, Great Tartary, Etc. to Peking ; Containing an Exact and Particular Description of the Extent and Limits of Those Countries, and the Customs of the Barbarous Inhabitants; with Reference to Their Religion, Government, Marriages, Daily Imployments, Habits, Habitations, Diet Death, Funerals etc. to which is Annex\u0027d an Accurat Description of China, Done Originally by a Chinese isbn\u003d|edition\u003d|publisher\u003d C. and R. location\u003d editor\u003d|volume\u003d page\u003d passage\u003d The old Siberian Russians affirm that the \u0027\u0027Mammuth\u0027\u0027 is very like the Elephant\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mastodon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something very large of its kind\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"producing an aggregate of nearly twelve cords\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mammothrept", "{\"term\":\"mammothrept\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027mammothreptus\u0027 from Hellenistic Ancient greek (to 1453) \u0027μαμμόθρεπτος\u0027 (brought up by one’s grandmother) from \u0027μάμμη\u0027 (grandmother) + \u0027θρεπτός\u0027 verbal adjective from \u0027τρέφω\u0027 (to bring up)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spoilt child\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1601\u0027\u0027, \u0027Fountaine of Selfe-love\u0027, IV.3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"O, you are a meere \u0027\u0027\u0027mammothrept\u0027\u0027\u0027 in judgement, then. Why, doe you not obserue how excellently the dittie is affected in euerie place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027, \u0027The Diary of Samuel Marchbanks\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She concludes, \u0026quot;you better apologize.\u0026quot; The day I apologize to you, you contumacious \u0027\u0027mammothrept\u0027\u0027, there will be two moons in the sky\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, \u0027Master \u0026amp; Commander\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"‘And having seen the parents I am impatient to see this youth, the fruit of their strangely unattractive loins: will he be a wretched \u0027\u0027mammothrept\u0027\u0027?’\", \"priority\":7}]}, \"synonyms\":{}}");

	add("mampara", "{\"term\":\"mampara\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Unknown. But possibly an onomatopeic rendition of the call of the Cape Turtle Dove. A slang term used by hunters for this particularly silly pigeon.{{audio|CapeTurtleDove.ogg|Cape Turtle Dove|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fool ; a buffoon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Every week the \u0027Sunday Times\u0027 names and shames a mampara - generally a public figure who has said or done something so idiotic that it boggles the mind\", \"priority\":2}]}, \"synonyms\":{}}");

